(3, 'Trading profit', 'If I exercise manual for one session of 2 hours and I then exercise auto trading, how does the system work for trading profit for that day ?', '2018-08-10 21:00:38', 0, 1, 'SP000001', 116, 'Hi, Pniti , if you was trade in by using manual for the first time & the Trading was on running already , you will not allow to change your trade in by using auto system in next round , \r\n\r\nThe system will be debit your manual system interest rate become hold day in auto system payout , \r\n(0.35% - pay-ed interest rate of 1 round manual system = your balance auto interest rate for the day) ', '2018-08-12 12:37:25'),
